import React from 'react'
import { Link, NavLink } from "react-router-dom";
import {
  Navbar,
  NavItem,
  NavDropdown,
  MenuItem,
  Nav,
  Button,
} from "react-bootstrap";
import { IoIosLogIn, IoMdPerson } from "react-icons/io";

function SignedInLink() {
    return (
      <Nav>
        <Nav.Link href="#deets">
          <Button variant="light">
            <IoMdPerson /> New Restaurant
          </Button>
        </Nav.Link>
        <Nav.Link href="#memes">
          <Button variant="light">
            <IoIosLogIn /> Log Out
          </Button>
        </Nav.Link>
      </Nav>
    );
}
 export default SignedInLink;
